function App() {

  return (

    <div className="flex">
      <div className={`bg-dark-purple h-screen w-72 relative text-white`}>
        <img src="./logo192.png" alt="dravyafolio" className="right-0 absolute cursor-pointer h-5 w-5 top-9 right- border-2 border-dark-purple" />

      </div>
      <div className="p-7 text-2xl flex-1 first-letter h-screen font-semibold">
        <h1>Home Page</h1>
      </div>
    </div>
  );
}

export default App;
